igned studio is perfect for solo travelers or couples. It is light and airy, with a sky light and big windows (also great for cooling). It is exactly as described, and although I didn't make a roast, I was able to use the stove to make some meals at home. The neighborhood is lively and friendly, everything you need is here--cafes, grocery stores, parks and live entertainment. Located near public transportation, there's no need to have a car. Thomas is an excellent host, easily available and responsive to questions or needs.###Thomas' flat is great. Good location and perfect size for a solo traveler or a couple. I definitely recommend it.###Thomas is a very attentive, kind and communitive host. The whole check in process went smoothly. He was so kind to welcome me with a bottle of red wine, fruits, and chocolate and invited me to his office for coffee.  The location is just amazing and tons of restaurants, supermarkets shops in the neighborhood. In the LOFT you've everything you need. It is cozy but perfect for single traveler or a couple. It's on the top floor without lift, so if you have heavy luggage just be prepared.  ###Thomas is an exceptionally accommodating host. He went out of his way to make me feel welcome in the neighbourhood, down to having drinks and meals with me. I can only say good things about him.&#x0D;
